widgets.props:
JS{{
  const transport = [
    { label: '^backward-fast', on: 'playback_line_to_start', mode: 'tap' },
    { label: '^backward', on: 'playback_backward_one_frame', mode: 'push' },
    { label: "#_{@_{this} === 'play/stop' ? '^pause' : '^play'}", on: 'play/stop', mode: 'toggle' },
    { label: '^stop', on: 'playback_stop', mode: 'tap', onValue: `set('transport/2', 0, {send: false})` },
    { label: '^forward', on: 'playback_forward_one_frame', mode: 'push' },
    { label: '^forward-fast', on: 'playback_line_to_end', mode: 'tap' },
  ]

  const props = {
    mode: transport[$].mode,
    label: transport[$].label,
    on: transport[$].on,
  };

  if (transport[$].onValue) {
    props.onValue = transport[$].onValue;
  }

  return props;
}}

widgets.onValue:
const i = getIndex(id)

if ((i === 1 || i === 4) && value[i] !== 0) {
  let interval = setInterval(() => {
    send('localhost:8080', '/SibeliusConnect/command', value[i])
    if (get(id) === 0) {
      clearInterval(interval)
    }
  }, 50)
} else {
  if (i === 2 && value[i] === 0) {
    value[i] = getProp(id, 'on');
  }
  send('localhost:8080', '/SibeliusConnect/command', value[i])
}

