      if (typeof cur === 'string') {

        cur = cur.trim()

        if (!cur.startsWith('/')) {
          return [...acc, cur]
        }

        const wId = cur.substring(1)
        let wValue = get(wId)
        let wAddress = getProp(wId, 'address')

        if (wAddress && (wAddress.endsWith('/command') || wAddress.endsWith('/plugin'))) {
          wAddress = wAddress.substring(wAddress.lastIndexOf('/') + 1)
        }

        if (Array.isArray(wValue) || getProp(wId, 'linkId') === '>>macro') {
          return [...acc, ...resolveCommands(wValue)]
        } else if (wValue) {
          return [...acc, `${wAddress}:${wValue}`]
        } else {
          console.warn(`Variable ${cur} not found.`);
          send('localhost:8080', '/NOTIFY', '^circle-exclamation', `${cur} not found.`)
          return acc
        }
      }

      return [...acc, cur]
    }, [])
}

